import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { StatusBar } from "expo-status-bar";
import { Component, ReactNode, useEffect, useState } from "react";
import { Button, FlatList, StyleSheet, Text, TouchableHighlight, View, Image, Platform, ActivityIndicator, Dimensions } from 'react-native';
import MapView from "react-native-maps";
import { NativeScreenNavigationContainer, ScreenStack } from "react-native-screens";

function HomeScreen({navigation}:any) {
  return (
    <View style={styles.container}>
      <Text>This is My HomeScreen</Text>
      <Button title="Go To Profile" onPress={() => navigation.navigate("Profile")}></Button>
    </View>
  )
}

function ProfileScreen() {
  return (
    <View style={styles.container}>
      <Text>This is My ProfileScreen</Text>
    </View>
  )
}

function OrdersScreen() {
  return (
    <View style={styles.container}>
      <Text>This is My OrdersScreen</Text>
    </View>
  )
}

// Create the object of Stack
const Stack = createNativeStackNavigator();

// Screens are to be registered over here
export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name='Home' component={HomeScreen}/>
        <Stack.Screen name='Profile' component={ProfileScreen}/>
        <Stack.Screen name='Orders' component={OrdersScreen}/>
      </Stack.Navigator>
    </NavigationContainer>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  map: {
    width: Dimensions.get('window').width,
    height: Dimensions.get('window').height,
  },
});
